import React from 'react';
import InvestCard from '../Card.js'
import ProfitChart from '../ProfitChart.js'

let PrivateHawk = () => {
    return (
        <div>
            <h3 style={{
                borderBottom: '1px solid black', 
                padding: '15px'
            }}>Investors</h3>
            <div style={{
                padding: '25px', 
                paddingRight: '12.5px', 
                paddingLeft: '12.5px'
            }}>
                <InvestCard investorname='Dolor Sit' amount='500' iprofilepic='data:image/jpeg;base64,'></InvestCard>
            </div>       
        </div>
    )
}

export default PrivateHawk;
